			"text": "대선을 앞두고 여성과 성소수자들은 어느 때보다도 차별금지법의 필요성을 소리높여 외치고 있다. 차별금지법을 간절히 원하는 사람들 중에는 이주노동자를 비롯한 외국인들도 포함되어 있다는 사실을 기억하자. https://t.co/ofy5VVbror https://t.co/HxdNJUFt2v",
