		"text": "\"회사 측에 따르면 지난 2월 체결한 경영권 및 주식 양수도 계약의 양수인은 ISPC와 블루인베스트였다. 계약 당일 양도인은 총 양수도 대금 100억원(200만주) 가운데 30억원(60만주)을 계약금으로 블루인베스트에 양도했다.\"",
