		"text": "\"현재 고척돔의 대관 일정을 관리하고 있는 서울시설공단 홈페이지에는 오는 6월6일부터 11일까지 5일 대관신청이 이뤄져 있다. 그리고 행사일은 10일(토요일)로 명기됐다.\"",
